import {useWallet} from '@solana/wallet-adapter-react';
import React, {useMemo} from 'react';


export const WalletMulti = () => {
    const {publicKey} = useWallet();
    const base58 = useMemo(() => publicKey?.toBase58(), [publicKey]);

    return (
        <a>
            {base58}
        </a>);
};
